<p>
女性らしさを追求したメカニカルモデルです。<br>
ダイヤルの大きさに比べて引き締まった細めのかん幅で、装着時の軽やかさと華奢感を演出。<br>ケースのしなやかなカーブデザインは、若さと女性らしさを感じさせます。ダイヤルには奥深い輝きを放つ放射型打パターンを採用しており、レディスモデルとしては大振りなケースと響きあうインデックスや針によってレディスとして格段の視認性を確保。優れた着け心地と実用性を合わせ持つ女性向けのグランドセイコーです。</p>
</div>

<br><br>

<h5>9Sメカニカルムーブメントとは？</h5>
<p>
ぜんまいのほどける力を動力源として、正確に時を刻む機械式時計。<br>
チチチチチ。耳を澄ますと聞こえるのは、ムーブメントが刻む“精緻な時”の音色。<br>
9Sメカニカルは、先端技術(MEMS※)を用いた緻密なパーツ製造を採用。、<br>
パーツは職人の手によって一つひとつ丁寧に磨き上げられ、1／1000mm単位の調整が行われて、<br>
初めてグランドセイコーの厳しい精度基準をクリアしたクオリティーに到達。<br>
先端技術(MEMS※)と熟練した匠の組立・調整技術の融合が可能にした、日常生活の中で高精度を維持できる<br>
 “毎日使える機械式時計の最高峰”となりました。<br>
※MEMS：MicroElectroMechanicalSystems技術の略で、半導体の製造技術を応用し、電気と機械を融合したデバイス<br>
</p>
